import { createID } from "./create-id";
describe("create-id", () => {
    it("creates IDs starting with given prefix followed by hexademical numbers and dashes", () => {
        expect(createID("MyPrefix")).toMatch(/^MyPrefix-[\-0-9a-f]+/);
    });
    it("returns unique IDs for each call", () => {
        expect(createID("MyPrefix")).not.toEqual(createID("MyPrefix"));
    });
});
